import axios from 'axios';
function Data() {
  const [data, setData] = useState([]);



  useEffect(() => {
    axios.get('http://localhost:5000/api/data')
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);
  

 // console.log(data);
  return (
    
    <div className="App">
      <h1>visitors names</h1>
      <table>

<tr>
  <th>Visitor Name</th>
  <th>Visitor email</th>
  <th>Action</th>
</tr>


     
        {data.map((item) => (
           
           
           
                   <tr key={item._id}>
                   <td>{item.name}</td>
                   <td>{item.email}</td>
                   <td><button>update</button><button></button></td>
                   </tr>
                

           
          
         
         
        ))}
     
      </table>
    </div>
  );
}

export default Data;
